import React, { useState, useEffect } from "react";
import { BrowserRouter, Route } from "react-router-dom";
import "./App.css";
import About from "./components/pages/About";

function App() {
  return (
    <BrowserRouter>
      <Route>
        <About />
      </Route>
    </BrowserRouter>
  );
}

export default App;
